import React, { Component } from "react";
import "./App.css";
import Nav from "./Nav/Nav";

class App extends Component {
  render() {
    return (
      <div className="container">
        <Nav />
        <div class="container">
          <div class="row">
            <div class="col-sm">
              <h1>Get the best of Tonic in one App!</h1>
              <p>
                Have a health need? Tonic brings you 21st century care to your
                fingertips.
              </p>

                <p><i class="far fa-dot-circle">Basic Features</i></p>
                <p><i class="far fa-dot-circle">Our Clients</i></p>
                <p><i class="far fa-dot-circle">Services</i></p>
            </div>
            <div className="row">
              <div>
              <a style="margin-right: 20px;" href="https://play.google.com/store/apps/details?id=com.telenorhealth.tonicapp"><img src="/sites/all/themes/tonicplus/dist/images/icons/google-play-icon.png.pagespeed.ce.s294OT_ljV.png" alt="" data-pagespeed-url-hash="1594306563" onload="pagespeed.CriticalImages.checkImageForCriticality(this);"/></a>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
